import React from "react"
import s from "./Register.module.css"

let first_name_text = "";

const Register = () => {
    const change = (e) => {
        first_name_text = e.target.value;
    }

    return (
      <div className={s.Register}>
          <div className={s.item}>
          Firtst name:   <input value={first_name_text} name="FirstName" onChange={change} />
          </div>
          <div className={s.item}>
          Last name: <input type="text" name="FirstName" value="Mickey"/>
          </div>
      </div>
    );
}

export default Register;
